import React, { Component } from "react";

class CommentBox extends Component {

  state = {};

  render() {
    return (
      <div>
        <form>
          <h4>Add a Comment</h4>
          <textarea />
          <div>
            <button>Submit Commit</button>
          </div>
        </form>
      </div>
    );
  }
}

export default CommentBox;
